Bing Satellites - Summer Night (2CD ambient music album)

Well over 2 hours of quality ambient music
from Manchester musician and remixer Bing Satellites.
Influenced by Harold Budd, Brian Eno, Namlook, Boards Of Canada, Thomas Fehlmann and Ulrich Schnauss.

First release from BFW Recordings.

Also on The Pirate Bay - 
Look out for 'Bing Satellites Ambient Mixes' - over 3 and a half hours of the best ambient music compiled and mixed by Bing Satellites
